CREATE TABLE SGDTEST.TVS_PAIS
(
    IDE_PAIS NUMBER(18) PRIMARY KEY NOT NULL,
    NOMBRE_PAIS VARCHAR2(64) DEFAULT NULL
,
    COD_PAIS VARCHAR2(7) NOT NULL,
    ESTADO CHAR(2) DEFAULT NULL
,
    FEC_CAMBIO TIMESTAMP(6) DEFAULT NULL
,
    FEC_CREACION TIMESTAMP(6) DEFAULT NULL
,
    COD_USUARIO_CREA VARCHAR2(20) DEFAULT NULL

);
